A gothic metal band from Germany, consisting of Franziska Huth (vocals), Waldemar Sorychta (guitar), Alla Fedynitch (bass) and Tom Diener (drums). This is a new band by metal legend Waldemar Sorychta, the guitarist, songwriter and producer who shaped the sound and feel of Grip Inc., Lacuna Coil, Sentenced, Moonspell, Tiamat, Despair and countless others? The band members themselves describe their style as ?beautiful, bittersweet, mystical, dark, intense. And always Rock.? Their debut album, under the name ?Faith?, was recently released in August 2007.

